Everytime you alter the qx.data.Array it fires a "change" event to list, to render itself again. So you do not need to fire a "listItemChange" event.
Just remove the "fireEvent("listItemChange");

Ok, i found the bug.

First of all.... when using qooxdoo properties pls use the automatic generate getter and setter...
Otherwise qooxdoo is not capable to fire events like "apply" or change.

this.getListItemMenu()
this.setListItemMenu()

etc

But the "bug" you discovered is actually a feature. Because of performance issues, the model of the only rendered the parts of the list, which are changed (added/removed) recently.
But in your case, the sort is not detected automatically.... , so the render does not trigger.

You can trigger re-rendering of whole list, by re-assigning the model to the list:


         this.__application.addListener("listItemChange",function(){
                    	console.log("listItemChange");
                    	this.sort();	

	// Re-rendering...
	this.__list.setModel(null);
	this.__list.setModel(this.getListItemMenu());
                },this);

I check if  automatical re-rendering can be triggered, after sorting the model. Or i can provide a public rendering method.
